<area shape="rect" id="id1" href="Feature.html" title="Feature is a unit of consumption of product functionality. " alt="" coords="598,838,672,894"/>
<area shape="rect" id="id2" href="IssuePriority.html" title="Issue priority, e.g. Low, Medium, High. " alt="" coords="286,531,386,587"/>

<area shape="rect" id="id4" href="IssueStatus.html" title="Issue status, e.g. Open, In Progress, Done. " alt="" coords="337,707,435,776"/>

<area shape="rect" id="id7" href="KeyResult.html" title="Key Results are specific measures used to track achievement of their containing objective. " alt="" coords="777,83,882,167"/>
